import axios from 'axios';
import React, {useState, useEffect} from 'react';
import { useParams } from "react-router-dom";

const OrderProduct = () => {

    const [orderData, setOrderData] = useState([]);
    const [filterOrders, setFilterOrders] = useState(orderData);  
    const { id } = useParams();

    useEffect(() => {
        console.log("Hello World")
        getOrderedProduct();
    }, [])

    const getOrderedProduct = () => {
        axios.get(`/order/get/${id}`)
        .then((response) => {
            setOrderData(response.data);
            setFilterOrders(response.data);
            console.log(response.data);
        })
    }

    const ShowOrderedProduct = () => {
        return (
            <div className="text-center">
              <div className="card">
                <div className="card-body">
                  <h5 className="card-title">{orderData.boughtAt}</h5>
                  <h6 className="card-subtitle mb-2 text-muted">{orderData.product.username}</h6>
                  <h6 className="card-subtitle mb-2 text-muted">{orderData.address}</h6>
                  <p className="card-text">
                  </p>
                </div>
              </div>
            </div>
          );
    }

  return (
    <ShowOrderedProduct />
  )
}

export default OrderProduct
